import React from 'react';
import Form from 'react-bootstrap/Form'; 

export default function Login() {
  return (
    <>
        <Form>
            <Form.Group className="mt-3 col-6" controlId>
                <Form.Control type="text" placeholder="Enter your name"/>
            </Form.Group>
        </Form>
    </>
  )
}
